import React from "react";
import "./projects.css";
import editor from "../../assets/editor.png";
import eCommerce from "../../assets/eCommerce.png";
import healthCard from "../../assets/healthCard.png";
import formFiller from "../../assets/formFiller.png";
import virtualTherapist from "../../assets/virtualTherapist.png";
import reservation from "../../assets/reservation.png";

const Projects = () => {
  const projectData = [
    {
      image: editor,
      title: "Editor",
      description:
        "With the use of RectJs, I have developed an editor for HTML and CSS with a preview using the React library.",
      githubLink: "https://github.com/dhruvi1930/editor",
    },
    // Add other project data similarly
  ];

  return (
    <section id="projects">
      <h2 className="projectsTitle">My Projects</h2>
      <div className="projectsWrapper">
        {projectData.map((project, index) => (
          <div className="container" key={index}>
            <div
              className="projectBackground"
              style={{ backgroundImage: `url(${project.image})` }}
            ></div>
            <h3>{project.title}</h3>
            <p className="projectDescription">{project.description}</p>
            <a href={project.githubLink}>
              <button className="btnProject">GitHub </button>
            </a>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Projects;
